import React from "react";

function App() {
  const formSubmitted = (e) => {
    e.preventDefault();
  };

  return (
    <div>
      <form onSubmit={formSubmitted}>
        <label>Username</label>
        <input type="text" />
        <label>Age (Years)</label>
        <input type="number" />
        <button type="submit">Add User</button>
      </form>

      <p>Ingen brukere lagt til</p>
    </div>
  );
}

export default App;
